alue\", \"Test\");\ncy.get(\"#account_middle_name\").type(\"Test\").should(\"have.value\", \"Test\");\ncy.get(\"#account_last_name\").type(\"Test\").should(\"have.value\", \"Test\");\ncy.get(\"#account_dob\").type(\"1999-04-06\", {\n  force: true\n}).should(\"have.value\", \"1999-04-06\");\ncy.get(\".ant-picker-cell-selected\").click();\ncy.get(\"#account_nationality\").type(\"Australia{enter}\");\ncy.get(\":nth-child(6) &gt; .ant-form-item &gt; .ant-row &gt; .ant-form-item-control &gt; .ant-form-item-control-input &gt; .ant-form-item-control-input-content &gt; .ant-select &gt; .ant-select-selector &gt; .ant-select-selection-item\").click();\ncy.get(&#x27;[title=\"Male\"] &gt; .ant-select-item-option-content&#x27;).click();\ncy.get(\"#account_phone_country_code\").type(\"91\").should(\"have.value\", \"91\");\ncy.get(\"#account_phone\").type(\"9712355577\").should(\"have.value\", \"9712355577\");\ncy.get(\".ant-btn\").click();\n// STEP 2 VALIDATION\ncy.get(&#x27;.proced-btn&#x27;).click();\ncy.get(\"#account_resid_building_name_help &gt; .ant-form-item-explain-error\").invoke(\"text\").then(text =&gt; {\n  expect(text.trim()).to.equal(\"Please Input Building Name / Number\");\n});\ncy.screenshot();\ncy.get(\"#account_resid_street_help &gt; .ant-form-item-explain-error\").invoke(\"text\").then(text =&gt; {\n  expect(text.trim()).to.equal(\"Please Input Your Street Name\");\n});\ncy.get(\"#account_resid_city_help &gt; .ant-form-item-explain-error\").invoke(\"text\").then(text =&gt; {\n  expect(text.trim()).to.equal(\"Please Input Your City Name\");\n});\ncy.get(\"#account_resid_zipcode_help &gt; .ant-form-item-explain-error\").invoke(\"text\").then(text =&gt; {\n  expect(text.trim()).to.equal(\"Please Input Your Area Name\");\n});\ncy.get(\"#account_resid_country_help &gt; .ant-form-item-explain-error\").invoke(\"text\").then(text =&gt; {\n  expect(text.trim()).to.equal(\"Please Select Your Country Name\");\n});\ncy.get(\"#account_issue_date_help &gt; .ant-form-item-explain-error\").invoke(\"text\").then(text =&gt; {\n  expect(text.trim()).to.equal(\"Please Select Your Issue Date\");\n});\ncy.get(\"#account_proof_of_res_help &gt; .ant-form-item-explain-error\").invoke(\"text\").then(text =&gt; {\n  expect(text.trim()).to.equal(\"Please Upload Proof of Residence\");\n});\ncy.get(\"#account_resid_building_name\").type(\"Testbuilding\").should(\"have.value\", \"Testbuilding\");\ncy.get(\"#account_resid_street\").type(\"132ft\").should(\"have.value\", \"132ft\");\ncy.get(\"#account_resid_city\").type(\"sevenhills\").should(\"have.value\", \"sevenhills\");\ncy.get(\"#account_resid_zipcode\").type(\"380013\").should(\"have.value\", \"380013\");\ncy.get(\"#account_resid_state\").type(\"sydney\").should(\"have.value\", \"sydney\");\ncy.get(\"#account_resid_country\").type(\"Australia{enter}\");\ncy.get(\"#account_issue_date\").click();\ncy.get(\".ant-picker-today-btn\").click();\ncy.get(`input[type=file]`).selectFile(\"cypress/fixtures/Demoimg.jpg\", {\n  force: true\n});\ncy.get(\".proced-btn\").click();\ncy.get(\".proced-btn\").click();\ncy.get(&#x27;#passport_help &gt; .ant-form-item-explain-error&#x27;).invoke(\"text\").then(text =&gt; {\n  expect(text.trim()).to.equal(\"Please Choose Passport\");\n});\ncy.get(&#x27;#termsAndConditon_help &gt; .ant-form-item-explain-error&#x27;).invoke(\"text\").then(text =&gt; {\n  expect(text.trim()).to.equal(\"Please accept the terms &amp; conditions\");\n});","err":{},"uuid":"ce4bb8c9-0df5-4636-95eb-a274635198a6","parentUUID":"a9dd79ec-4a8d-4869-a80d-f794155f793c","isHook":false,"skipped":false}],"suites":[],"passes":["d8a9ff0a-f36f-4003-b881-a7115680b138","b7771689-9366-4e7f-8ebd-97a81c37fc98","ce4bb8c9-0df5-4636-95eb-a274635198a6"],"failures":[],"pending":[],"skipped":[],"duration":33369,"root":false,"rootEmpty":false,"_timeout":2000}],"passes":[],"failures":[],"pending":[],"skipped":[],"duration":0,"root":true,"rootEmpty":true,"_timeout":2000}],"meta":{"mocha":{"version":"7.0.1"},"mochawesome"
